import React from 'react';
import headerImg from '../../media/images/headerImg.jpeg'

const Header = () => {

    return (
        <div className="header">
            <img src={headerImg} alt="Houston Rockets" />
            <div className="gameDetail">
                <h3>Home Team vs Away Team</h3>
                <h3>Home Score || Away Score</h3>
                <h3>Game Date</h3>
                <h3>Game Time</h3>
                <h3>Game Status</h3>
            </div>
        </div>
    )
}

export default Header;
